  false,\n\t\"url\": null,\n\t\"notes\": \"To determine the relative needs of the
  U.S. Fish and Wildlife Service, the Federal Highway Administration (FHWA) was asked
  to inventory all public access and administrative (Service use only) roads and parking
  lots and provide a condition assessment of each. This report summarizes the inventory
  for East Fork Salmon River National Fish Hatchery.u00a0All roads and parking lots
  were mapped using Trimble GPS units and visually assessed for condition using the
  RSL method of evaluation developed at Utah State University. A cost estimate for
  maintenance and construction of roads is provided in the report.\",\n\t\"license_title\":
